import React, { useEffect, useState } from 'react';
import {
  Box, Container, Typography, Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, Paper, Button, Select, MenuItem, FormControl, InputLabel
} from '@mui/material';
import axios from 'axios';
import AdminNavbar from '../components/AdminNavbar';

const AdminAssignTechnician = () => {
  const [complaints, setComplaints] = useState([]);
  const [technicians, setTechnicians] = useState([]);
  const [selectedTechnicians, setSelectedTechnicians] = useState({});

  useEffect(() => {
    // Fetch complaints
    const fetchComplaints = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/complaints');
        setComplaints(response.data);
      } catch (error) {
        console.error('Error fetching complaints:', error);
      }
    };

    // Fetch technicians
    const fetchTechnicians = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/technicians');
        setTechnicians(response.data);
      } catch (error) {
        console.error('Error fetching technicians:', error);
      }
    };

    fetchComplaints();
    fetchTechnicians();
  }, []);

  const handleTechnicianChange = (complaintId, technicianId) => {
    setSelectedTechnicians(prev => ({ ...prev, [complaintId]: technicianId }));
  };

  const handleAssignTechnician = async (complaintId) => {
    const technicianId = selectedTechnicians[complaintId];
    if (!technicianId) return;

    try {
      await axios.put(`http://localhost:5000/api/complaints/${complaintId}/assign-technician`, {
        technicianId
      });
      alert('Technician assigned successfully');
      // Optionally, refresh complaints to reflect the changes
    } catch (error) {
      console.error('Error assigning technician:', error);
    }
  };

  return (
    <div>
  
      <Container>
        <Typography variant="h4" gutterBottom>Assign Technicians to Complaints</Typography>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Complaint ID</TableCell>
                <TableCell>Lab</TableCell>
                <TableCell>System Number</TableCell>
                <TableCell>Complaint</TableCell>
                <TableCell>Assign Technician</TableCell>
                <TableCell>Action</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {complaints.map((complaint) => (
                <TableRow key={complaint._id}>
                  <TableCell>{complaint._id}</TableCell>
                  <TableCell>{complaint.lab}</TableCell>
                  <TableCell>{complaint.systemNumber}</TableCell>
                  <TableCell>{complaint.complaint}</TableCell>
                  <TableCell>
                    <FormControl fullWidth>
                      <InputLabel>Select Technician</InputLabel>
                      <Select
                        value={selectedTechnicians[complaint._id] || ''}
                        onChange={(e) => handleTechnicianChange(complaint._id, e.target.value)}
                      >
                        {technicians.map((technician) => (
                          <MenuItem key={technician._id} value={technician._id}>
                            {technician.name}
                          </MenuItem>
                        ))}
                      </Select>
                    </FormControl>
                  </TableCell>
                  <TableCell>
                    <Button
                      variant="contained"
                      color="primary"
                      onClick={() => handleAssignTechnician(complaint._id)}
                    >
                      Assign
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Container>
    </div>
  );
};

export default AdminAssignTechnician;
